import React from 'react';
import ""

const Home = () => {
    return (
        <div className="home">
            <div className="container">
                <div className="home-information">
                    <h2 className="home-title margin-bottom">AMRI</h2>
                    <h4 className="home-info">Creative Director</h4>
                    <p className="dome-desc">
                    Je suis développeur <span>Back-End</span> & <span>Font-End</span>, créer des conceptions modernes et réactives pour le Web et le mobile. travaillons ensemble. Je vous remercie.
                    </p>
                    <button className="home-btn">Let's begin</button>
                </div>
            </div>
        </div>
    );
}




export default Home;
